import './App.css';
import { Fragment } from 'react'
import Navbar from './components/layout/Navbar';
import Landing from './components/layout/Landing';
import { Route,  Routes } from 'react-router-dom';

function App() {
  return (

      <Fragment>
        <Navbar/>
        <Routes>
          <Route exact path="/" element={<Landing />} />
        </Routes>
      </Fragment>

  );
}

export default App;
